PRINT ''
PRINT '2.1. Tablero Dashboard 1 - Ventas Mensuales.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (1, N'Ventas Mensuales', 2, N'Ventas Mensuales', N'Ultimo Año', N'SELECT SUBSTRING(CONVERT(varchar(11), V.Fecha, 120),3,5)
--	    ,MONTH(V.fecha)
      ,ROUND(SUM(V.ImporteTotal)/1000000,2) AS ImporteTotal 
  FROM Ventas V
 INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = V.IdTipoComprobante 
 WHERE V.IdSucursal >= 1
   --AND V.Fecha >= ''20200101 00:00:00''
   --AND V.Fecha <= ''20201221 23:59:59''
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))				
   AND TC.AfectaCaja = ''True'' 
   AND TC.EsComercial = ''True'' 
  --GROUP BY MONTH(V.fecha)
  GROUP BY SUBSTRING(CONVERT(varchar(11), V.Fecha, 120),3,5)  
--ORDER BY 1
', 0, 1, 1, , CAST(15.00 AS Decimal(15, 2)), CAST(9.00 AS Decimal(15, 2)), 0, 9, 1, N'Meses', N'Importes (Millones)', 1, 10, 0)
GO

PRINT ''
PRINT '2.2. Tablero Dashboard 2 - Utilidades por Mes.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (2, N'Utilidades por Mes', 2, N'Utilidades por Mes', N'Ultimo Año', N'SELECT SUBSTRING(CONVERT(varchar(11), V.Fecha, 120),3,5)
--	    ,MONTH(V.fecha)
      ,ROUND(SUM(V.Utilidad)/1000000,2) AS Utilidades
  FROM Ventas V
 INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = V.IdTipoComprobante 
 WHERE V.IdSucursal >= 1
   --AND V.Fecha >= ''20200101 00:00:00''
   --AND V.Fecha <= ''20201221 23:59:59''
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))				
   AND TC.AfectaCaja = ''True'' 
   AND TC.EsComercial = ''True'' 
  --GROUP BY MONTH(V.fecha)
  GROUP BY SUBSTRING(CONVERT(varchar(11), V.Fecha, 120),3,5)  
--ORDER BY 1
', 0, 1, 1, , CAST(2.00 AS Decimal(15, 2)), CAST(1.00 AS Decimal(15, 2)), 0, 3, 1, N'Meses', N'Importes (Millones)', 1, 20, 0)
GO

PRINT ''
PRINT '2.3. Tablero Dashboard 3 - Ventas por Rubro (Top 10).'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (3, N'Ventas por Rubro (Top 10)', 2, N'Ventas por Rubro (Top 10)', N'Ultimo Año', N'
DECLARE @TotalDeVentas DECIMAL(12,2) = (
SELECT SUM(ImporteTotalNeto) AS TotalGeneral FROM
(SELECT TOP(10) R.NombreRubro 
      ,SUM(VP.ImporteTotal) AS ImporteTotalNeto
--      ,SUM(VP.Cantidad) AS Cantidad
--      ,SUM(VP.ImporteTotalNeto+VP.ImporteImpuesto+VP.ImporteImpuestoInterno) AS ImporteTotal
--      ,SUM(VP.Kilos) AS Kilos
  FROM Ventas V, VentasProductos VP, TiposComprobantes TC,
       Productos P, Rubros R
 WHERE V.IdSucursal = VP.IdSucursal
   AND V.IdTipoComprobante = VP.IdTipoComprobante
   AND V.Letra = VP.Letra
   AND V.CentroEmisor = VP.CentroEmisor
   AND V.NumeroComprobante = VP.NumeroComprobante
   AND V.IdTipoComprobante = TC.IdTipoComprobante
   AND VP.IdProducto = P.IdProducto
   AND P.IdRubro = R.IdRubro
   AND TC.AfectaCaja = ''True''
   AND TC.EsComercial = ''True''
   AND V.IdSucursal >= 1
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))	---''20200101 00:00:00''
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))					---''20201221 23:59:59''
 GROUP BY R.NombreRubro
 ORDER BY ImporteTotalNeto DESC
) AS TablaUno
);


SELECT TOP(10) R.NombreRubro 
      ,ROUND(SUM(VP.ImporteTotal)/@TotalDeVentas*100,2) AS ImporteTotalPorc
--      ,SUM(VP.Cantidad) AS Cantidad
--      ,SUM(VP.ImporteTotalNeto+VP.ImporteImpuesto+VP.ImporteImpuestoInterno) AS ImporteTotal
--      ,SUM(VP.Kilos) AS Kilos
  FROM Ventas V, VentasProductos VP, TiposComprobantes TC,
       Productos P, Rubros R
 WHERE V.IdSucursal = VP.IdSucursal
   AND V.IdTipoComprobante = VP.IdTipoComprobante
   AND V.Letra = VP.Letra
   AND V.CentroEmisor = VP.CentroEmisor
   AND V.NumeroComprobante = VP.NumeroComprobante
   AND V.IdTipoComprobante = TC.IdTipoComprobante
   AND VP.IdProducto = P.IdProducto
   AND P.IdRubro = R.IdRubro
   AND TC.AfectaCaja = ''True''
   AND TC.EsComercial = ''True''
   AND V.IdSucursal >= 1
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))	---''20200101 00:00:00''
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))					---''20201221 23:59:59''
 GROUP BY R.NombreRubro
 ORDER BY ImporteTotalPorc DESC
;
', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), 0, 14, 1, N'', N'', 1, 30, 1)
GO

PRINT ''
PRINT '2.4. Tablero Dashboard 4 - Ventas por Producto (Top 10).'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (4, N'Ventas por Producto (Top 10)', 2, N'Ventas por Producto (Top 10)', N'Ultimo Año', N'
DECLARE @TotalDeVentas DECIMAL(12,2) = (
SELECT SUM(Importe) AS TotalGeneral FROM
(SELECT TOP(10)
	VP.NombreProducto,
 -- SUM(vp.Cantidad) AS Cantidad,
  SUM(VP.ImporteTotal) AS Importe
 FROM VentasProductos vp
 INNER JOIN Ventas v ON v.IdSucursal = vp.IdSucursal 
			AND v.IdTipoComprobante = vp.IdTipoComprobante 
			AND v.Letra = vp.Letra 
			AND v.CentroEmisor = vp.CentroEmisor
			AND v.NumeroComprobante = vp.NumeroComprobante 
 INNER JOIN TiposComprobantes TC ON V.IdTipoComprobante = TC.IdTipoComprobante 
  WHERE V.IdSucursal >= 1
    AND TC.AfectaCaja = ''True'' 
    AND TC.EsComercial = ''True'' 
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))				
 GROUP BY VP.NombreProducto
 ORDER BY Importe desc
) AS TablaUno
);


SELECT TOP(10) VP.NombreProducto
 --, SUM(vp.Cantidad) AS Cantidad,
      ,ROUND(SUM(VP.ImporteTotal)/@TotalDeVentas*100,2) AS ImporteTotalPorc
 FROM VentasProductos vp
 INNER JOIN Ventas v ON v.IdSucursal = vp.IdSucursal 
			AND v.IdTipoComprobante = vp.IdTipoComprobante 
			AND v.Letra = vp.Letra 
			AND v.CentroEmisor = vp.CentroEmisor
			AND v.NumeroComprobante = vp.NumeroComprobante 
 INNER JOIN TiposComprobantes TC ON V.IdTipoComprobante = TC.IdTipoComprobante 
  WHERE V.IdSucursal >= 1
    AND TC.AfectaCaja = ''True'' 
    AND TC.EsComercial = ''True'' 
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))				
 GROUP BY VP.NombreProducto
 ORDER BY ImporteTotalPorc desc
', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), 0, 14, 1, N'', N'', 1, 40, 1)
GO

PRINT ''
PRINT '2.5. Tablero Dashboard 5 - Ventas vs Cobranzas.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (5, N'Ventas vs Cobranzas', 2, N'Ventas vs Cobranzas', N'Ultimo Año', N'SELECT V.Periodo, V.Ventas, C.Cobranzas
FROM
(
	SELECT SUBSTRING(CONVERT(varchar(11), Fecha, 120),3,5) AS Periodo, ROUND(SUM(ImporteTotal)/1000000,2) AS Ventas
	FROM Ventas
	 INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = Ventas.IdTipoComprobante AND TC.AfectaCaja = ''True'' AND TC.EsComercial = ''True''
	 WHERE IdSucursal >= 1
	   AND CONVERT(DATE, Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
       AND CONVERT(DATE, Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))		
	 GROUP BY SUBSTRING(CONVERT(varchar(11), Fecha, 120),3,5)
) V,
(
	SELECT SUBSTRING(CONVERT(varchar(11), Fecha, 120),3,5) AS Periodo, ROUND(SUM(ImporteTotal*-1)/1000000,2) AS Cobranzas
	FROM CuentasCorrientes
	 INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = CuentasCorrientes.IdTipoComprobante AND TC.EsRecibo = ''True''
	 WHERE IdSucursal >= 1
	   AND CONVERT(DATE, Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
       AND CONVERT(DATE, Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))		
	 GROUP BY SUBSTRING(CONVERT(varchar(11), Fecha, 120),3,5)
) C
 WHERE V.Periodo = C.Periodo
 ORDER BY 1
', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), 0, 3, 1, N'Meses', N'Importes (Millones)', 1, 50, 1)
GO

PRINT ''
PRINT '2.6. Tablero Dashboard 6 - Posicion de IVA.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (6, N'Posicion de IVA', 2, N'Posicion de IVA', N'Ultimo Año', N'SELECT Periodo, Posicion FROM
(
SELECT TOP (12) PeriodoFiscal, RIGHT(PeriodoFiscal,2) AS Periodo, ROUND(Posicion/1000,2) AS Posicion
  FROM PeriodosFiscales
   WHERE PeriodoFiscal< CONVERT(INTEGER,REPLACE(LEFT(CONVERT(VARCHAR(11), GETDATE(), 120),7),''-'',''''))
-- ORDER BY 1 DESC
) T1
', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), 0, 9, 1, N'Meses', N'Importes (Miles)', 1, 60, 0)
GO

PRINT ''
PRINT '2.7. Tablero Dashboard 7 - Comisiones por Vendedores.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (7, N'Comisiones por Vendedores', 2, N'Comisiones por Vendedores', N'Ultimo Año', N'DECLARE @vendedores VARCHAR(MAX)
SET @vendedores = ( 
SELECT QUOTENAME(E.NombreEmpleado) + '','' --AS Vendedor
  FROM Ventas V
INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = V.IdTipoComprobante AND TC.AfectaCaja = ''True'' AND TC.EsComercial = ''True''
INNER JOIN Empleados E ON V.IdVendedor = E.IdEmpleado 
 WHERE V.IdSucursal >= 1
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))				
 GROUP BY E.NombreEmpleado 
 HAVING SUM(V.ComisionVendedor) > 0
 ORDER BY 1
FOR XML PATH(''''))

SET @vendedores = SUBSTRING(@vendedores, 0, LEN(@vendedores))

PRINT @vendedores

DECLARE @SQLString nvarchar(MAX);

set @SQLString = N''SELECT *
  FROM (SELECT SUBSTRING(CONVERT(varchar(11), V.Fecha, 120),3,5) AS MES, E.NombreEmpleado AS Vendedor, ROUND(SUM(V.ComisionVendedor)/1000,2) AS SumaComisionVendedor
  FROM Ventas V
INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = V.IdTipoComprobante AND TC.AfectaCaja = ''''True'''' AND TC.EsComercial = ''''True''''
INNER JOIN Empleados E ON V.IdVendedor = E.IdEmpleado 
 WHERE V.IdSucursal >= 1
   AND CONVERT(DATE, V.Fecha, 120) >= DATEADD(YY,-1,(CAST(GETDATE()-DAY(GETDATE())+1 AS DATE)))
   AND CONVERT(DATE, V.Fecha, 120) <= CONVERT(DATE, GETDATE()-DAY(GETDATE()))				
 GROUP BY SUBSTRING(CONVERT(varchar(11), V.Fecha, 120),3,5), E.NombreEmpleado 
 HAVING SUM(V.ComisionVendedor) > 0
 ) a
 PIVOT (SUM(SumaComisionVendedor) FOR Vendedor IN ('' + @vendedores + '')) AS a
 ''
--PRINT @SQLString
EXECUTE sp_executesql @SQLString
', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), 0, 3, 0, N'Meses', N'Importes (Miles)', 1, 70, 1)
GO

PRINT ''
PRINT '2.8. Tablero Dashboard 8 - Total de Pedidos.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (8, N'Total de Pedidos', 1, N'Total de Pedidos', N'Mes Actual', N'SELECT COUNT(P.IdSucursal) FROM Pedidos P
 INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = P.IdTipoComprobante AND TC.Tipo = ''PEDIDOSCLIE''
 INNER JOIN PedidosEstados PE ON PE.IdSucursal = P.IdSucursal 
                                 AND PE.IdTipoComprobante = P.IdTipoComprobante
                                 AND PE.Letra = P.Letra
                                 AND PE.CentroEmisor = P.CentroEmisor
                                 AND PE.NumeroOrdenProduccion = P.NumeroPedido
 INNER JOIN EstadosPedidos EP ON EP.IdEstado = PE.IdEstado AND EP.IdTipoEstado NOT IN (''ANULADO'',''RECHAZADO'')
 WHERE P.IdSucursal >= 1
   AND YEAR(P.FechaPedido) = YEAR(GETDATE())
   AND MONTH(P.FechaPedido) = MONTH(GETDATE())
;
', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), NULL, NULL, NULL, N'', N'', 1, 80, 0)
GO

PRINT ''
PRINT '2.9. Tablero Dashboard 9 - Total de Presupuestos.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (9, N'Total de Presupuestos', 1, N'Total de Presupuestos', N'Mes Actual', N'SELECT COUNT(P.IdSucursal) FROM Pedidos P
 INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = P.IdTipoComprobante AND TC.Tipo = ''PRESUPCLIE''
 INNER JOIN PedidosEstados PE ON PE.IdSucursal = P.IdSucursal 
                                 AND PE.IdTipoComprobante = P.IdTipoComprobante
                                 AND PE.Letra = P.Letra
                                 AND PE.CentroEmisor = P.CentroEmisor
                                 AND PE.NumeroOrdenProduccion = P.NumeroPedido
 INNER JOIN EstadosPedidos EP ON EP.IdEstado = PE.IdEstado AND EP.IdTipoEstado NOT IN (''ANULADO'',''RECHAZADO'')
 WHERE P.IdSucursal >= 1
   AND YEAR(P.FechaPedido) = YEAR(GETDATE())
   AND MONTH(P.FechaPedido) = MONTH(GETDATE())
;
', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), NULL, NULL, NULL, N'', N'', 1, 90, 0)
GO

PRINT ''
PRINT '2.10. Tablero Dashboard 10 - Total de Ordenes de Produccion.'
PRINT ''
INSERT [dbo].[DashBoardsPaneles] ([IdDashBoard], [Nombre], [TipoDashBoard], [Titulo], [Comentario], [SentenciaSQL], [AutoRefresh], [TipoRefresh], [TimerRefresh], [ImagenDashBoard], [ValorObjetivo], [ValorMinimo], [Area3DStyle], [ModeloDashBoard], [ShowValueLabel], [AxisTitleX], [AxisTitleY], [Estado], [Orden], [VisualizaLeyenda]) VALUES (10, N'Total de Ordenes de Produccion', 1, N'Total de Ordenes de Produccion', N'Mes Actual', N'--SELECT * FROM OrdenesProduccion OP
SELECT COUNT(OP.IdSucursal) FROM OrdenesProduccion OP
 INNER JOIN TiposComprobantes TC ON TC.IdTipoComprobante = OP.IdTipoComprobante AND TC.Tipo = ''PRODUCCION''
 INNER JOIN OrdenesProduccionEstados OPE ON OP.IdSucursal = OP.IdSucursal 
                                 AND OPE.IdTipoComprobante = OP.IdTipoComprobante
                                 AND OPE.Letra = OP.Letra
                                 AND OPE.CentroEmisor = OP.CentroEmisor
                                 AND OPE.NumeroOrdenProduccion = OP.NumeroOrdenProduccion
 INNER JOIN EstadosOrdenesProduccion EOP ON EOP.IdEstado = OPE.IdEstado AND EOP.IdTipoEstado NOT IN (''ANULADO'',''RECHAZADO'')
 WHERE OP.IdSucursal >= 1
   AND YEAR(OP.FechaOrdenProduccion) = YEAR(GETDATE())
   AND MONTH(OP.FechaOrdenProduccion) = MONTH(GETDATE())
;

', 0, 1, 1, , CAST(0.00 AS Decimal(15, 2)), CAST(0.00 AS Decimal(15, 2)), NULL, NULL, NULL, N'', N'', 1, 100, 0)
GO

